################################################################################

def calculate_volume_dennis(heights):
    # Dennis' Solution
    volume = 0
    stack = []
    
    for i in range(len(heights)):
        # if there's nothing in the stack, push the first building onto it
        if len(stack) == 0:
            stack.append((heights[i], i))
            
        # if the next building's height is shorter than the top of the stack, push
        elif heights[i] < stack[-1][0]:
            stack.append((heights[i], i))
            
        # if the next building's height is taller than the top of the stack, time to do some math
        elif heights[i] > stack[-1][0]:
            
            # calculate which side of the pool of water is lower
            left_bound_height = stack[0][0]
            right_bound_height = heights[i]
            min_height_of_bounds = min(left_bound_height, right_bound_height)
            
            # we will be computing the volume by moving from right bound to left bound and calculating each rectangle of water
            index_pointer = i # moves towards the left as we process the stack
            while len(stack) > 0 and stack[-1][0] <= min_height_of_bounds:
                
                # add the rectangle of water above the building popped from the stack
                height_index_tuple = stack.pop()
                volume += (min_height_of_bounds - height_index_tuple[0]) * (index_pointer - height_index_tuple[1])
                
                # move the pointer to the left by assigning it to the index of the last popped element of the stack
                index_pointer = height_index_tuple[1] 
            
            # push the right bound onto the stack, but give it the left bound (should now be what the pointer points to)
            stack.append((right_bound_height, height_index_tuple[1]))
    return volume

