def calculate_volume_vijay(heights):
    # Vijay's Solution
    if(len(heights)<=2):
        return 0
    end = len(heights)-1
    i = 0
    vol = 0
    while i+2 <= end:
        if(heights[i] > heights[i+1]):
            # this loop basically tries to find a
            # right end for pool
            # it stops when we've either iterated
            # through all the buildings or we
            # find a right end that exceeds left end
            j = i+1
            for x in range(i+2,end+1):
                if(heights[x] > heights[j]):
                    j = x
                    if(heights[j] > heights[i]):
                        break
            # take min of left and right ends
            _min = min(heights[i],heights[j])
            # go through each building in middle
            # and increase vol by delta between
            # min building size and current building
            for y in range(i+1,j):
                vol += _min-heights[y]
            i = j
        else:
            i+=1
               
    # put your brilliant code here
    return vol

