def calculate_volume_nate(heights):
    # Nate's Solution
    skip = -1
    volumne = 0
    
    #corner cases.
    if len(heights) in (0, 1, 2):
        return volumne
    
    
    for i in range(len(heights) - 1):
        
        if i < skip: continue
        index = numpy.argmax(heights[i + 1 :]) + (i + 1)
        value = heights[index]
                
        heights_comparedTo = min(heights[i], value)
        
        #corner case where b_i and b_k are adjacent buildings.
        if (i + 1 == index):
            skip = index - 1
            continue
            
        for j in range(i + 1, index):
            '''
            corner case where b_j > b_i.
            note that for this special case, b_i = heights_compareTo.
            because b_j is strictly less than b_k.
            '''
            if heights[j] > heights_comparedTo:
                skip = j
                break
            volumne += heights_comparedTo - heights[j]
        if (j == index - 1):
            skip = index
        
    return volumne

